The first, and simplest function to write is vector.get(i), which returns a pointer to the element at index i . Here is the code to that implements get. /// Return a *const T to the index specified
///
/// # Safety
/// The index this is called on **must** be a valid index, meaning:
/// there must already be a bucket allocated which would hold that index
/// **and** the index must already have been initialized with push/set
unsafe fn get(&self, i: usize) -> *const AtomicU64 { // Check for overflow let pos = i .checked_add(FIRST_BUCKET_SIZE) .expect("index too large, integer overflow"); let hibit = highest_bit(pos); let offset = pos ^ (1 << hibit); // Select the correct buffer to index into // # Safety // Since hibit = highest_bit(pos), and pos >= FIRST_BUCKET_SIZE // The subtraction hibit - highest_bit(FIRST_BUCKET_SIZE) cannot underflow let buffer = &self.buffers[(hibit - highest_bit(FIRST_BUCKET_SIZE)) as usize]; // Check that the offset doesn't exceed isize::MAX assert!( offset .checked_mul(mem::size_of::<T>()) .map(|val| val < isize::MAX as usize) .is_some(), "pointer offset exceed isize::MAX bytes" ); // Offset the pointer to return a pointer to the correct element unsafe { // # Safety // We know that we can offset the pointer because we will have allocated a // bucket to store the value. Since we only call values that are // `self.descriptor.size` or smaller, we know the offset will not go out of // bounds because of the assert. buffer.load(Ordering::Acquire).add(offset) }
