The solution I came up with is to make sure a reference to a WriteDescriptor never outlives the reference to it's parent Descriptor. Visually this looks like: -- Descriptor Reference Start -- WriteDescriptor Reference Start -- WriteDescriptor Reference End -- Descriptor Reference End This means that when there are no people accessing a Descriptor, there are also no people accessing the inner WriteDescriptor. Therefore, when a Descriptor is retireded, the WriteDescriptor is also safe to retire because there are no references to it. Since no one can get a new reference to a retireed Descriptor, no once can access the inner WriteDescriptor. Why is this important? Whenever we reclaim a Descriptor, we also reclaim the inner WriteDescriptor, fixing our leaks without causing any UB. To implement this custom behavior for Descriptor, we implement the Drop trait. A type that implements Drop executes some custom behavior when it goes out of scope and is reclaimed. The Drop implementation looks like this: impl<T> Drop for Descriptor<'_, T>
{ fn drop(&mut self) { // # Safety // The pointer is valid because it's from Box::into_raw // We must also ensure ref to wdesc never outlasts ref to desc unsafe { Box::from_raw( self.pending .swap_ptr(ptr::null_mut()) .unwrap() .into_inner() // This is a NonNull<T> .as_ptr() // Turn it into a raw pointer ); } }
